import React from "react";
import { about_links } from "../data";

export default function Footer() {
  return (
    <>
      <footer className="footer" id="footer">
        <ul className="footer-links">
          {about_links.map(link(<li key={link.name}>{link.name}</li>))}
        </ul>
      </footer>
    </>
  );
}
